import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import NavBar from "./Components/NavBar";
import { useState } from "react";

function App() {
  const [step, setStep] = useState(0);
  function handleNext() {
    if (step < 3) {
      setStep((s) => s + 1);
    }
  }
  function handlePrev() {
    if (step > 0) {
      setStep((s) => s - 1);
    }
  }
  return (
    <NavBar>
      stepProp = {step}
      onNext = {handleNext} onPrev = {handlePrev}
    </NavBar>
  );
}

export default App;
